import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id:'1',
        title: 'Some event',
    },
    {
        id:'1',
        title: 'Some event',
    }
]
function EventPage() {
    return <>
    <h1>Events</h1>;
    <ul>
        {DUMMY_EVENTS.map(event => <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
        </li>)}
    </ul>
    </>
}

export default EventPage;
